def all_in(required, l):
    return all(r in l for r in required)


def any_new_all_present(items, new, total):
    return all_in(items, total) and any(i == new for i in items)


def fullmovement(obtained):
    return all_in(["claw", "wings", "mothwing", "c-dash"], obtained)


def pantheoncheck(obtained, pantheon):
    if "dive" not in obtained:
        return False
    if pantheon == 1:
        if (
            "gruz" in obtained
            and "false knight" in obtained
            and "hornet 1" in obtained
            and "gorb" in obtained
            and "dung defender" in obtained
            and ("mawlek" in obtained or "colo3" in obtained)
        ):
            return True
        return False

    requirements = {
        2: [
            "xero",
            "colo2",
            "mantis lords",
            "marmu",
            "flukenest",
            "nosk",
            "broken vessel",
        ],
        3: [
            "hive knight",
            "elder hu",
            "collector",
            "grimm",
            "galien",
            "uumuu",
            "hornet 2",
        ],
        4: [
            "p1",
            "p2",
            "p3",
            "wings",
            "broken vessel",
            "no eyes",
            "traitor lord",
            "dung defender",
            "false knight",
            "markoth",
            "watcher knights",
            "soul master",
        ],
    }
    return all_in(requirements[pantheon], obtained)


